import "materialize-css/dist/css/materialize.min.css";
import M from 'materialize-css'; 


class topnav extends Component {



    componentDidMount() {
        const options = {
          inDuration: 250,
          outDuration: 200,
          draggable: true
        };
    
        M.Dropdown.init(this.Dropdown);
    
        let instance = M.Dropdown.getInstance(this.Dropdown);
        instance.open();
        console.log(instance.isOpen);
      }


    render() {
        return (
            <div>
                       <div>
                          <nav>
    <div class="nav-wrapper">
      <a href="#" class="brand-logo">Krishi</a>
      <ul id="nav-mobile" class="right hide-on-med-and-down">
        <li><a href="#"></a></li>
        <li ref={Dropdown => {
            this.Dropdown = Dropdown;
          }}><a class="dropdown-trigger" href="#!" data-target="dropdown1">Dropdown<i class="material-icons right">arrow_drop_down</i></a></li>
        
      </ul>
    </div>
  </nav> 
        </div> 
            </div>
        )
    }
}

export default topnav
